import React from 'react';
import NavigationBar from './components/NavBar/NavigationBar';
import './App.css';

const App = () => {
  const gridStyling = {
    container: {
      paddingBottom: 2,
      paddingRight: 2,
      marginTop: 2,
      marginLeft: 12,
      marginRight: 12,
    }
  };
  return (
    <>
      <body>
        <NavigationBar/>
        <HomePage/>
      </body>
    </>
  );
}

export default App;
